package main

import "fmt"

func makePatternMap(bytes []byte) map[byte]int {
	phitMap := make(map[byte]int)
	for i := 0; i < len(bytes); i++ {
		char := bytes[i]
		count, _ := phitMap[char]
		phitMap[char] = count + 1
	}
	return phitMap
}

func isMapEqual(map1, map2 map[byte]int) bool {
	// fmt.Println("map1:", map1)
	// fmt.Println("map2:", map2)
	for char, count := range map1 {
		count2, _ := map2[char]
		if count != count2 {
			return false
		}
	}
	return true
}

func findAnagrams(s, p string) []int {
	indices := []int{}
	slen := len(s)
	plen := len(p)
	if slen < plen {
		return indices
	}

	patternMap := makePatternMap([]byte(p))
	sbytes := []byte(s)
	moveMap := makePatternMap(sbytes[0:plen])
	prevWindowMatch := false
	if isMapEqual(patternMap, moveMap) {
		prevWindowMatch = true
		indices = append(indices, 0)
	}
	for i := plen; i < slen; i++ {
		removeChar := s[i-plen]
		addChar := s[i]
		if addChar == removeChar && prevWindowMatch {
			indices = append(indices, i-plen+1)
			prevWindowMatch = true
			continue
		}
		moveMap[removeChar] = moveMap[removeChar] - 1
		moveMap[addChar] = moveMap[addChar] + 1
		if isMapEqual(patternMap, moveMap) {
			prevWindowMatch = true
			indices = append(indices, i-plen+1)
		} else {
			prevWindowMatch = false
		}
	}
	return indices
}

func main() {
	str0 := []byte("abcd")
	fmt.Println(str0[0:2])
	fmt.Println("[0,1,2] -> ", findAnagrams("abab", "ab"))
	fmt.Println("[0,6] -> ", findAnagrams("cbaebabacd", "abc"))

	str1 := ""
	str2 := ""

	fmt.Println("[0, 10001]", findAnagrams(str1, str2))
	fmt.Println("len1 ", len(str1))
	fmt.Println("len2 ", len(str2))
}
